from django.db import modelsfrom apps.account.models import Accountfrom apps.logus.models import ServiceModel, TariffModel, LogusChequeModelclass TariffServiceModel(models.Model):    service = models.ForeignKey(ServiceModel, on_delete=models.CASCADE)    tariff = models.ForeignKey(TariffModel, on_delete=models.CASCADE)    created_by = models.ForeignKey(Account, related_name="tariff_service", on_delete=models.SET_NULL, null=True)    created_at = models.DateTimeField(auto_now_add=True)    modified_at = models.DateTimeField(auto_now=True)    modified_by = models.ForeignKey(Account, related_name="modf_tariff_service", on_delete=models.SET_NULL, null=True)    def __str__(self):        return f"{self.tariff} - {self.service}"class AdditionallyPurchasedServicesModel(models.Model):    service = models.ForeignKey(ServiceModel, on_delete=models.CASCADE, related_name='purchased_services')    cheque = models.ForeignKey(LogusChequeModel, on_delete=models.CASCADE, related_name='purchased_services')    created_by = models.ForeignKey(Account, related_name="purchased_services", on_delete=models.SET_NULL, null=True)    created_at = models.DateTimeField(auto_now_add=True)    modified_at = models.DateTimeField(auto_now=True)    modified_by = models.ForeignKey(Account, related_name="modf_purchased_services", on_delete=models.SET_NULL, null=True)    def __str__(self):        return f"{self.service} - {self.cheque}"